  false,\n\t\"url\": null,\n\t\"notes\": \"The Ash Meadows region of southwest Nevada
  has evolved since the last period of glaciation into a unique alkali desert ecosystem.
  The remnant springs, pools and streams, and the area's unusual soils combine to
  support an endemic flora. The year-round supply of water also provides habitat for
  several species of endangered pupfish. The Nature Conservancy, a national, non-profit
  organization dedicated to preserving biotic diversity, has secured an option to
  purchase 320 acres in the heart of Ash Meadows. The optioned property is one of
  the least disturbed and most representative examples of the Ash Meadows ecosystem.
  Acquisition will ensure protection of the Ash Meadows pupfish and preserve intact
  a part of this unique desert environment, including three endangered plant species.
  Funding for the establishment of the preserve is urgently needed.\",\n\t\"license_title\":
